import React from "react";
import "../styles/Home.css";

const Home = () => {
  return (
    <div className="home-container">
      <header className="home-header">
        <h1>Bienvenido al Turnero</h1>
        <p>Comienza reservando un turno o viendo los docentes disponibles.</p>
      </header>
      <div className="home-buttons">
        <button className="home-button blue-button">Ver Docentes</button>
        <button className="home-button green-button">Reservar Turno</button>
      </div>
    </div>
  );
};

export default Home;
